    return (
        <div>
            <h1>Панель администратора</h1>
            <ul>
                <li>
                    <Link to="/admin-employee-access">Учет доступа сотрудников</Link>
                </li>
                <li>
                    <Link to="/admin-departments">Управление департаментами</Link>
                </li>
                <li>
                    <Link to="/hazardous-jobs-admin">Управление опасными работами</Link> {/* Новая ссылка */}
                </li>
                {/* Добавьте другие ссылки на административные функции, если необходимо */}
            </ul>
        </div>
    );
}

export default Admin;
